import React from 'react';

function HelloDiv() {
  return 
  <>     
  <p>Hello my name is Tony</p>

  <ul><i>Things I like: </i>

  <li>Basketball</li>
  <li>Eating</li>
  <li>Sleeping</li>
  </ul>
  </>;
}



export default HelloDiv;
